describe("multi map",function(){var e;beforeEach(module("ui.bootstrap.modal")),beforeEach(inject(function(o){e=o.createNew()})),it("should add and remove objects by key",function(){e.put("foo","bar"),expect(e.get("foo")).toEqual(["bar"]),e.put("foo","baz"),expect(e.get("foo")).toEqual(["bar","baz"]),e.remove("foo","bar"),expect(e.get("foo")).toEqual(["baz"]),e.remove("foo","baz"),expect(e.hasKey("foo")).toBe(!1)}),it("should support getting the keys",function(){e.put("foo","bar"),e.put("baz","boo"),expect(e.keys()).toEqual(["foo","baz"])}),it("should return all entries",function(){e.put("foo","bar"),e.put("foo","bar2"),e.put("baz","boo"),expect(e.entries()).toEqual([{key:"foo",value:["bar","bar2"]},{key:"baz",value:["boo"]}])}),it("should preserve semantic of an empty key",function(){expect(e.get("key")).toBeUndefined()}),it("should respect removal of non-existing elements",function(){expect(e.remove("foo","bar")).toBeUndefined()})});